import React from "react";
import Product from "./product.json";
import { Box, Image, Text } from "@chakra-ui/react";

const CartItems = () => {
  

  return (
    <>
      {Product.map((item, index) => {
        return (
          <Box key={index}>
            <Image src={item.images} />
          </Box>
        );
      })}
    </>
  );
};

export default CartItems;
